package com.commonchicken.dto;

public class ProductDTO {
	private String prdCode;
	private String prdName;
	private String prdPrice;
	private int prdCategory;
	private int prdStatus;
	private String stoNum;
	private String memEmail;
	private String prdOrigin;
	private String prdUpload;
	
	public ProductDTO() {
		// TODO Auto-generated constructor stub
	}

	public String getPrdCode() {
		return prdCode;
	}

	public void setPrdCode(String prdCode) {
		this.prdCode = prdCode;
	}

	public String getPrdName() {
		return prdName;
	}

	public void setPrdName(String prdName) {
		this.prdName = prdName;
	}

	public String getPrdPrice() {
		return prdPrice;
	}

	public void setPrdPrice(String prdPrice) {
		this.prdPrice = prdPrice;
	}

	public int getPrdCategory() {
		return prdCategory;
	}

	public void setPrdCategory(int prdCategory) {
		this.prdCategory = prdCategory;
	}

	public int getPrdStatus() {
		return prdStatus;
	}

	public void setPrdStatus(int prdStatus) {
		this.prdStatus = prdStatus;
	}

	public String getStoNum() {
		return stoNum;
	}

	public void setStoNum(String stoNum) {
		this.stoNum = stoNum;
	}

	public String getMemEmail() {
		return memEmail;
	}

	public void setMemEmail(String memEmail) {
		this.memEmail = memEmail;
	}

	public String getPrdOrigin() {
		return prdOrigin;
	}

	public void setPrdOrigin(String prdOrigin) {
		this.prdOrigin = prdOrigin;
	}

	public String getPrdUpload() {
		return prdUpload;
	}

	public void setPrdUpload(String prdUpload) {
		this.prdUpload = prdUpload;
	}
	
	
	
}
